import React from 'react'
import './Loading.scss'

export default function Loading() {
    return (
        <div class="spinner">
            <span class="spinner-inner-1"></span>
            <span class="spinner-inner-2"></span>
            <span class="spinner-inner-3"></span>
        </div>
    )
}
